import React from 'react';

import './Style.css';
const Card = (props) => {
    return (
        <>
           <div className='Cardcmp'>

                    <img src={props.src} alt='image'/>
        
        <div className='details'>
               <h2>{props.title}</h2>
               <p>{props.details}</p>
               </div>
           </div>
            
            

        </>
    );
}

export default Card;
